Look up and create or update object inside array<p>I am currently trying to setup a schema for custom Discord guild commands:</p>
<pre class="lang-js prettyprint-override"><code>const GuildCommandsSchema = new mongoose.Schema({
    _id: String,
    commands: [
        {
            name: {
                type: String,
                unique: true,
                required: true,
            },
            action: {
                type: String,
                required: true,
            },
            author: {
                type: String,
                required: true,
            },
        },
    ],
});
</code></pre>
<p>Is this ok, performancewise, or could I improve it?
I feel like Mongo would need to look through all commands, since it can't index any commands inside 'commands' even though 'name' is unique.</p>
<p>If that's fine, how can I access the values inside commands?
I would need to find the right command via 'name' if it exists, otherwise create it and add/update 'action' + 'author'.</p>
<p>I tried something like this:</p>
<pre class="lang-js prettyprint-override"><code>const updatedCommand = await GuildCommands.findOneAndUpdate(
                { _id },
                {
                    $set: {
                        [`commands.$[outer].name`]: name,
                        [`commands.$[outer].action`]: action,
                        [`commands.$[outer].author`]: author,
                    },
                },
                {
                    arrayFilters: [{ 'outer.name': name }],
                }
            );
</code></pre>
<p>Unfortunately that does not create commands if they don't exist.</p>
<p>Thanks for your help</p>

