Mongoose _id changes on every request<p>So, I am building an application using MongoDB as my Database. In my database exist 3 different schemas: <code>Section</code>, <code>Category</code>, and <code>Product</code>.</p>
<p>The schemas are defined as follows:</p>
<pre><code>let ProductSchema = new mongoose.Schema({
    name: String,
    price: String,
    imageLink: String
})

let CategorySchema = new mongoose.Schema({
    name: String,
    products: [{ ref: 'Product', type: mongoose.Types.ObjectId}],
    link: String
})

let SectionSchema = new mongoose.Schema({
    name: String,
    categories: [{ ref: 'Category', type: mongoose.Types.ObjectId }]
})
</code></pre>
<p>Then I have built a simple API, using <code>Express</code>, to test the integration, and when retrieving all the <code>Section</code>s, <code>Category</code>s and <code>Product</code>s using the <code>find()</code>method on their respective models, the <code>_id</code>s of the objects change. So, for example, for a simple query for a <code>Section</code> with its <code>_id</code>I get the following result:</p>
<pre><code>{
    &quot;_id&quot;: &quot;618042725b8fc016e4b76714&quot;,
    &quot;name&quot;: &quot;AHUMADOS Y CAVIAR&quot;,
    &quot;categories&quot;: [
        {
            &quot;_id&quot;: &quot;61804dee7ac1146082cdb4b2&quot;,
            &quot;products&quot;: []
        }
    ],
    &quot;__v&quot;: 0
}
</code></pre>
<p>Then I make the same request once again and I get the following:</p>
<pre><code>{
    &quot;_id&quot;: &quot;618042725b8fc016e4b76714&quot;,
    &quot;name&quot;: &quot;AHUMADOS Y CAVIAR&quot;,
    &quot;categories&quot;: [
        {
            &quot;_id&quot;: &quot;61804e257ac1146082cdb4b6&quot;,
            &quot;products&quot;: []
        }
    ],
    &quot;__v&quot;: 0
}
</code></pre>
<p>As you can see the <code>_id</code> of the objects inside <code>categories</code> change on every query, which is a weird behaviour. Does anybody know why this is happening?</p>
<p>Thank your in advance for your answers.</p>

